import React from "react";
import './portfolio.css';


const Works = () =>{
    return(
       
        <section id="portfolio">
            <span className="ptitle">My Portfolio</span><br/>
            <span className="pdesc">Crafted with precision, my portfolio showcases expertise in website development using HTML, CSS, and ReactJS. 
            <br />With a Bachelor's in Computer Science and a pursuit of a Master's degree via distance learning, I bring a robust technical background to every project.</span>
        </section>
    );
}

export default Works;
